sympy.sympy.core.numbers.__eq__:
def __eq__(self, other):
    if isinstance(other, int):
        return (self.p == other)
    elif isinstance(other, Integer):
        return (self.p == other.p)
    return Rational.__eq__(self, other)

sympy.sympy.core.relational.__new__:
def __new__(cls, lhs, rhs, **options) -> Equality | BooleanFalse | BooleanTrue: # type: ignore
    evaluate = options.pop('evaluate', global_parameters.evaluate)
    lhs = _sympify(lhs)
    rhs = _sympify(rhs)
    if evaluate:
        val = is_eq(lhs, rhs)
        if val is None:
            return cls(lhs, rhs, evaluate=False)
        else:
            return _sympify(val)

    return Relational.__new__(cls, lhs, rhs)

sympy.sympy.functions.elementary.piecewi:
def __new__(cls, *args, **options):
    if len(args) == 0:
        raise TypeError("At least one (expr, cond) pair expected.")
    # (Try to) sympify args first
    newargs = []
    for ec in args:
        # ec could be a ExprCondPair or a tuple
        pair = ExprCondPair(*getattr(ec, 'args', ec))
        cond = pair.cond
        if cond is false:
            continue
        newargs.append(pair)
        if cond is true:
            break

    eval = options.pop('evaluate', global_parameters.evaluate)
    if eval:
        r = cls.eval(*newargs)
        if r is not None:
            return r
    elif len(newargs) == 1 and newargs[0].cond == True:
        return newargs[0].expr

    return Basic.__new__(cls, *newargs, **options)

sympy.sympy.physics.vector.frame.__eq__:
def __eq__(self, other):
    # Check if the other object is a CoordinateSym of the same frame and
    # same index
    if isinstance(other, CoordinateSym):
        if other._id == self._id:
            return True
    return False
